import React from 'react';
import {css, StyleSheet} from 'aphrodite';
import Text from "../../../helpers/Text";

function Service({firstComponent, secondComponent, isButton = false, containerWidth = "14rem"}) {
    const style = StyleSheet.create({
        outer: {
            borderRadius: "8px",
            justifyContent: "space-between",
            padding: "1.3rem",
            border: "1px solid #EAE9F2",
            width: containerWidth,
            height: "1rem",
            marginBottom: "0.8rem",
        },
    })

    return (
        <div className={css(style.outer) + " alItCenter row"}>
            {firstComponent}
            {secondComponent}
        </div>
    );
}

export default Service;
